use std::collections::HashMap;

    pub fn max_operations(nums: Vec<i32>, k: i32) -> i32 {
        let mut result = 0;

        let mut map: HashMap<i32, i32> = HashMap::new();
        for num in nums.iter() {
            let count = map.entry(*num).or_insert(0);
            *count += 1;
        }
        println!("map: {:?}", map);

        let is_odd = k % 2;
        let center = k / 2;
        println!("k: {}, center: {}, is_odd: {}", k, center, is_odd);

        for count in 0..(k / 2) {
            let left_pointer = center - count;
            let right_pointer = center + count + is_odd;
            // println!("count: {}, left_pointer: {}, right_pointer: {}", count, left_pointer, right_pointer);
            if left_pointer == right_pointer {
                result += match map.get(&left_pointer) {
                    None => 0,
                    Some(num) => *num / 2
                }
            } else {
                let left = match map.get(&left_pointer) {
                    None => 0,
                    Some(num) => *num
                };
                let right = match map.get(&right_pointer) {
                    None => 0,
                    Some(num) => *num
                };
                result += if left < right { left } else { right };
            }
            // println!("result: {}", result);
        }

        result
    }


